import "./App.css";

function Feature(){

  return (
    <div className="feature">
      <img src="" alt="" className="feature-image" />

      <h3 className="feature-title">Title</h3>

      <p className="feature-desc">
        Lorem ipsum dolor sit amet, consectetur adipisicing elit. Molestias
        inventore rerum, error maiores asperiores delectus dolore fuga placeat
        commodi voluptates cumque minus unde velit eaque voluptatum. Totam earum
        nesciunt praesentium!
      </p>

    </div>
  )
}

function App() {

  return (
    <div>
    <Feature></Feature>
    <Feature></Feature>
    <Feature></Feature>
    <YoutubeItem></YoutubeItem>


    </div>
  );
}

function YoutubeItem(){

  return (

    <div className="youtube-item">
      <div className="youtube-image">

        <img src="https://unsplash.com/photos/4cTZXcnsJb8" 

        alt=""

        className="youtube-avatar"/>
        <div className="youtube-info"></div>
      </div>
    </div>

  )
}

export default App;
